INSERT INTO `SERVMASK_PREFIX_posts` VALUES ('54','2','2019-08-23 20:39:32','2019-08-23 20:39:32','Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.<img class=\"alignnone size-medium wp-image-47\" src=\"https://asfaf1.gepardwp.com/wp-content/uploads/woocommerce-placeholder-300x300.png\" alt=\"\" width=\"300\" height=\"300\" />','First Product','','publish','open','closed','','first-product','','','2019-08-23 20:39:55','2019-08-23 20:39:55','','0','https://asfaf1.gepardwp.com/?post_type=product&#038;p=54','0','product','','0');
